  summary: "\n<p>Represents an Accept-Encoding header value.with optional quality factor.</p>\n"
  remarks: "\n<p>The <xref href=\"System.Net.Http.Headers.TransferCodingWithQualityHeaderValue\" data-throw-if-not-resolved=\"false\"></xref>   class provides support for the Accept-Encoding header as defined in <see href=\"http://go.microsoft.com/fwlink/?LinkID=241642\">RFC 2616</see> by the IETF.</p>\n<p>Quality factors allow a user agent to indicate the relative degree of preference for an Accept-Encoding header value, using the qvalue scale from 0 to 1. The default value is q=1.</p>\n<p>This type derives from <xref href=\"System.Net.Http.Headers.TransferCodingHeaderValue\" data-throw-if-not-resolved=\"false\"></xref>.</p>\n"
